window.bookSummaryJSON = "<p><b>Book seven of the popular Delphi in Space series. </b></p> <p>The McCormacks have been forced to use their technology to protect their position on Earth, and have extended that to other nations as well. What will be the consequences? </p> <p>They’ve discovered two planets that appear to be suitable for colonization: one for the Paraxeans and one for Earth. But they need to make sure they’re really suitable. Follow them as they head into the galaxy to explore these two planets. Will Earth really want to colonize a planet? Will that bring them together, or tear nations apart?</p>"; 
